$(document).ready(function () {
    /*$('#login-form').off().on('submit', function (e) {
        e.preventDefault();

        hideError();
        submit($('#login').val(), $('#pass').val());
    });*/

    $('.js-btn-submit').on('click', function () {
            hideError();
            submit($('#login').val(), $('#pass').val());
        }
    );
    // $('.remember-pass').off().on(
    //     'click', function () {
    //         alert('По вопросу восстановления пароля напишите в техподдержку: siopr@mos.ru');
    //     }
    // );

    $('#login').off().on(
        'focus', function () {
            hideError();
        }
    );

    $('#pass').off().on(
        'focus', function () {
            hideError();
        }
    );

    function hideError() {
        $('#pass').removeClass('input-normal-error');
        $('#login').removeClass('input-normal-error');
        $('.login__error').hide();
    }

    var date = new Date();
    //var css = './img/autumn.png';
    switch (date.getMonth()) {
        case 0:
        case 1:
        case 2: css = './local/templates/siopr/img/winter.png'; break;
        case 3:
        case 4:
        case 5: css = './local/templates/siopr/img/spring.png'; break;
        case 6:
        case 7:
        case 8: css = './local/templates/siopr/img/summer.png'; break;
        case 9:
        case 10:
        case 11: css = './local/templates/siopr/img/autumn.png'; break;
    }

    $('.login__background').attr('src', css);
});

